import React, { ReactNode } from 'react';

 import { Filter, FilterTitle } from './styles';

 export interface CategoryProps {
  onClick?(): void;
  children?: ReactNode;
}


const Category: React.FC<CategoryProps> = ({
  onClick,
  ...CategoryProps
}) => {
  return (
    <Filter>
      <FilterTitle>
      {CategoryProps.children}
      </FilterTitle>
    </Filter>
  );
}

export default Category;
